import React from "react";
import {Card, Col} from "react-bootstrap";
import '../components/styles/contactUs.css';

const ContauctUs = (props) => {

    return(
        <Col md={{ span: 9, offset: 2 }}>
        <Card className='ContactUs row gx-3'>
            <Card.Img className='CardImg' src={props.card.image}></Card.Img>
            <Card.Title>
                {props.card.title}
            </Card.Title>
            <Card.Text>
                {props.card.content1}<br/>
                {props.card.content2}
            </Card.Text>
        </Card>
        </Col>
    );
};

export default ContauctUs;
